import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class WelcomePage extends Component {
    render() {
        return (

            <div styles={{ width: '100%', margin: 'auto' }}>
                <Grid className="welcomepage-grid">
                    <Cell col={12}>
                        <img
                            src="https://w7.pngwing.com/pngs/710/723/png-transparent-digital-marketing-computer-icons-technical-support-user-avatar-avatar-child-face-heroes.png"
                            alt="avatar"
                            className="avatar-img"
                        />

                        <div className="banner-text">
                            <h1 className="banner-text h1">" Frontend Developer "</h1>

                            <hr />   
                            <p>ReactJs | Javascript(intermediate) | Bootstrap(intermediate) | HTML/CSS(intermediate)</p>

                            
                            <div className="social-links">

                                {/* LinkedIn */}
                                <a href="https://www.google.com/" rel="noopenenr norefferer" targets="_blank">
                                    <i className="linkedin-square" aria-hidden="true"/>
                                </a>

                                  {/* GitHub */}
                                  <a href="https://www.google.com/" rel="noopenenr norefferer" targets="_blank">
                                    <i className="github-square" aria-hidden="true"/>
                                </a>
                            </div>    


                        </div>    

                    </Cell>
                </Grid>
            </div>

        );

    }
}

export default WelcomePage;
